import React from 'react';

function ContactPage() {
  return (
    <div className="container">
      <h1>Let's Connect</h1>
      <p>
        Are you ready to explore the unknown and push the boundaries of technology? 
        Whether you're a fellow hacker or a curious learner, let's collaborate and create 
        something extraordinary.
      </p>
      <h2>Social Links:</h2>
      <ul>
        <li><a href="https://linkedin.com" target="_blank" rel="noopener noreferrer">➜ LinkedIn</a></li>
        <li><a href="https://github.com" target="_blank" rel="noopener noreferrer">➜ GitHub</a></li>
        <li><a href="https://t.me" target="_blank" rel="noopener noreferrer">➜ Telegram</a></li>
      </ul>
    </div>
  );
}

export default ContactPage;
